import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import state, {addPost} from "./Redux/State";




export let rerenderEntireThree = () => {
    ReactDOM.render(

            <App
                state={state}
                addPost={addPost}/>,

        document.getElementById('root'));
};
